<style id="fidelius__styling">
      :root {
        --font-family: -apple-system;
        --title_color: #2d3737;
        --font-size: 16px;
        --background-color: #f2f2f2;
        --box-color: #ffffff;
        --btn-font-color: #ffffff;
        --btn-bg-color: #19A974;
        --btn-hover-color: #137752;
        --modal-overlay: rgba(0, 0, 0, 0.6);
        --modal-box-color: #ffffff;
        --modal-title-color: #137752;
        --modal-font-color: rgba(0, 0, 0, 0.8);
      }
      *,
      *:after,
      *:before {
        box-sizing: border-box;
      }
      body,
      html {
        font-family: var(--font-family), -apple-system, BlinkMacSystemFont, 
          'Segoe UI', 'Roboto', 'Oxygen', 'Ubuntu', 'Cantarell', 'Fira Sans', 
          'Droid Sans', 'Helvetica Neue', sans-serif;
        font-weight: 300;
        font-size: var(--font-size);
        background: var(--background-color);
        color: var(--title_color);
        display: flex;
        align-items: center;
        justify-content: center;
        min-height: 100%;
      }
      .fidelius__main {
        background: var(--box-color);
        -webkit-box-shadow: 0 2px 3px 0 rgba(0, 0, 0, 0.1);
        box-shadow: 0 2px 3px 0 rgba(0, 0, 0, 0.1);
        border-radius: 10px;
        min-width: 500px;
      }
      .fidelius__content {
        padding: 24px 28px;
        text-align: center;
      }
      .fidelius__content__heading {
        display: inline-block;
        vertical-align: middle;
        font-size: var(--font-size);
        font-weight: 400;
        margin: 0 0 12px;
        line-height: 1;
      }
      .fidelius__content__input {
        display: block;
        border: solid 1px #ccc;
        padding: 12px 14px;
        -webkit-box-shadow: 0 2px 3px 0 rgba(0, 0, 0, 0.1);
        box-shadow: 0 2px 3px 0 rgba(0, 0, 0, 0.1);
        font-size: var(--font-size);
        font-family: var(--font-family);
        width: 100%;
        border-radius: 5px;
        margin-bottom: 12px;
        text-align: center;
      }
      .fidelius__content__input:focus {
        outline: none;
        border-color: var(--btn-bg-color);
      }
      .fidelius__content__btn {
        background-color: var(--btn-bg-color);
        border-radius: 5px;
        cursor: pointer;
        border: none;
        color: var(--btn-font-color);
        padding: 12px 14px;
        font-family: var(--font-family), -apple-system, BlinkMacSystemFont, 
          'Segoe UI', 'Roboto', 'Oxygen', 'Ubuntu', 'Cantarell', 'Fira Sans', 
          'Droid Sans', 'Helvetica Neue', sans-serif;
        font-weight: 300;
        font-size: var(--font-size);
        width: 100%;
        transition: background-color 200ms ease-in-out;
      }
      .fidelius__content__btn:hover {
        background-color: var(--btn-hover-color);
      }
      @keyframes headShake {
        0% {
          transform: translateX(0);
        }

        6.5% {
          transform: translateX(-6px) rotateY(-9deg);
        }

        18.5% {
          transform: translateX(5px) rotateY(7deg);
        }

        31.5% {
          transform: translateX(-3px) rotateY(-5deg);
        }

        43.5% {
          transform: translateX(2px) rotateY(3deg);
        }

        50% {
          transform: translateX(0);
        }
      }
      .fidelius__headShake {
        animation: headShake 750ms ease-in-out 0ms 1 forwards;
        animation-name: headShake;
      }
      .fidelius__password__div {
        position: relative;
      }
      .fidelius__eye {
        position: absolute;
        top: 22.5%;
        right: 2%;
        opacity: 0.5;
        transition: opacity 200ms ease-in-out;
      }
      .fidelius__eye:hover {
        opacity: 1;
      }
      .fidelius__eye_open, .fidelius__eye_closed {
        width: 25px;
        height: 25px;
        cursor: pointer;
        z-index: 2;
      }
      .fidelius__icon__hint {
        cursor: pointer;
        display: inline-block;
        vertical-align: middle;
        margin: 0 0 12px;
        line-height: 1;
        width: 25px;
        height: 25px;
        transition: all 200ms ease-in-out;
      }
      .fidelius__icon__hint:hover {
        transform: scale(1.25);
      }

      /**************************\
  Modal Styles
\**************************/

.modal {
  font-family: var(--font-family), -apple-system, BlinkMacSystemFont, 
    'Segoe UI', 'Roboto', 'Oxygen', 'Ubuntu', 'Cantarell', 'Fira Sans', 
    'Droid Sans', 'Helvetica Neue', sans-serif;
}

.modal__overlay {
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: var(--modal-overlay);
  display: flex;
  justify-content: center;
  align-items: center;
}

.modal__container {
  background-color: var(--modal-box-color);
  padding: 15px;
  max-width: 500px;
  max-height: 100vh;
  min-width: 300px;
  border-radius: 4px;
  overflow-y: auto;
  box-sizing: border-box;
}

.modal__header {
  display: flex;
  justify-content: space-between;
  align-items: center;
}

.modal__title {
  margin-top: 0;
  margin-bottom: 0;
  font-weight: 400;
  font-size: 1.25rem;
  line-height: 1.25;
  color: var(--modal-title-color);
  box-sizing: border-box;
}

.modal__close {
  background: transparent;
  border: 0;
  cursor: pointer;
}

.modal__header .modal__close:before { content: "\2715"; }

.modal__content > p {
  margin: 0;
}

.modal__content {
  margin-top: 1rem;
  margin-bottom: 0rem;
  line-height: 1.5;
  color: var(--modal-font-color);
}

/**************************\
  Animation Style
\**************************/
@keyframes mmfadeIn {
    from { opacity: 0; }
      to { opacity: 1; }
}

@keyframes mmfadeOut {
    from { opacity: 1; }
      to { opacity: 0; }
}

@keyframes mmslideIn {
  from { transform: translateY(15%); }
    to { transform: translateY(0); }
}

@keyframes mmslideOut {
    from { transform: translateY(0); }
    to { transform: translateY(-10%); }
}

.micromodal-slide {
  display: none;
}

.micromodal-slide.is-open {
  display: block;
}

.micromodal-slide[aria-hidden="false"] .modal__overlay {
  animation: mmfadeIn .3s cubic-bezier(0.0, 0.0, 0.2, 1);
}

.micromodal-slide[aria-hidden="false"] .modal__container {
  animation: mmslideIn .3s cubic-bezier(0, 0, .2, 1);
}

.micromodal-slide[aria-hidden="true"] .modal__overlay {
  animation: mmfadeOut .3s cubic-bezier(0.0, 0.0, 0.2, 1);
}

.micromodal-slide[aria-hidden="true"] .modal__container {
  animation: mmslideOut .3s cubic-bezier(0, 0, .2, 1);
}

.micromodal-slide .modal__container,
.micromodal-slide .modal__overlay {
  will-change: transform;
}
    </style>

      document.addEventListener('DOMContentLoaded', function () {

          document.querySelector('#fidelius__content').innerText,
        )
        let hint = document.querySelector('#fidelius__hint').innerText

        let input = document.querySelector('.fidelius__content__input')
        input.focus()
        let content_box = document.querySelector('.fidelius__content')

        input.addEventListener('input', () => {
          input.style.borderColor = getComputedStyle(document.body).getPropertyValue('--btn-bg-color')
        })

        function toggle_password_show () {
          let show_icon = document.querySelector('.fidelius__eye > svg')
          if (input.type === "password") {
            input.type = "text"
            new_icon = document.createRange().createContextualFragment(fidelius__icons.eye_slash)
            show_icon.replaceWith(new_icon)
            input.focus()
          } else {
            input.type = "password"
            new_icon = document.createRange().createContextualFragment(fidelius__icons.eye)
            show_icon.replaceWith(new_icon)
            input.focus()
          }
        }

        showpass.addEventListener('touchend', toggle_password_show)

        function decrypter () {

          let password = input.value
          let password_hash = sodium.crypto_generichash(32, sodium.from_string(password))

            let html = sodium.crypto_secretbox_open_easy(
              content,
              nonce,
              password_hash,
            )
            let html_text = sodium.to_string(html)
            document.write(html_text)
            document.close()
          } catch (error) {
            // Incorrect password
            input.style.borderColor = "#E7040F"
            content_box.classList.add("fidelius__headShake")
            setTimeout(function() {
              content_box.classList.remove("fidelius__headShake");
            }, 250);
            input.select()
            input.focus()
          }
        }

        submit_btn.addEventListener('touchend', decrypter)

          if (e.keyCode === 13) {
            decrypter()
